import React, { Component } from 'react';
import './App.css';

class UsageTutorial extends Component {
    render() {
      return (
        <div>
          <h1> Usage </h1>
          <div> 
            <div className="summary">
              <p className="summary-header">Summary</p>
              <ul>
                <li> Add a new OKR with <code className="code"> /okr add </code></li>
                <li> View, manage, and share your OKRs with <code className="code"> /okr list </code></li>
                <li> Simple OKRs will remind you to check-in on your OKRs every two weeks</li>
                <li> See your options at any time with <code className="code"> /okr help </code> </li>
              </ul>
            </div>
            <h3>Adding a new OKR</h3>
            <h3>Viewing and Managing your OKRs</h3>
            <h3>Keeping you on track</h3>
          </div>
        </div>
      )
    }
}

export default UsageTutorial;
